import React from "react";
import { Helmet } from "react-helmet";

function events() {
  return (
    <div>
      <div id="instagram-feed1" className="instagram-feed"></div>
      <Helmet>
        <script style="text/jsx" src="../InstagramFeed.min.js"></script>
      </Helmet>
    </div>
  );
}

export default events;
